let rec clone x n =
  if (n<0 || n = 0) then []
  else
    let rec clonehelper tx tn =
      match (tn = 0) with
        | true -> []
        | false -> tx :: clonehelper tx (tn - 1)
    in
      clonehelper x (abs n)
;;


